import ApiManger from "./ApiManager";

export const user_login = async (data) => {
  try {
    const result = await ApiManger("/login", {
      method: "POST",
      headers: {
        "content-type": "applicaion/json",
      },
      data: data,
    });
    return result;
  } catch (error) {
    return error.response.data;
  }
};
